import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <h1>About Paradise Nursery</h1>
      <p>Welcome to Paradise Nursery, your one-stop shop for beautiful and healthy houseplants. We offer a variety of plants to brighten your home and purify the air.</p>
    </div>
  );
};

export default About;
